import React, { useState } from "react";

import AddIcon from '@material-ui/icons/Add';
import RemoveIcon from '@material-ui/icons/Remove';
const App=()=>
{

  const [num, setNum]=useState(0);
  const inc=()=>{
    setNum(num+1);
  }
  const dec=()=>{
    const newm=num-1;
    if(newm>=0)
    setNum(newm);
    else{
      alert("Cannot do operations below 0");
    }
  }

  return(
    <>
    <div className="main">
      <div className="box">
        <h1>{num}</h1>
        <div className="btn">
          <button onClick={inc} >
          <AddIcon/>
          </button>
          <button onClick={dec}>Decrement</button>
        </div>
      </div>
    </div>
    </>
  );
}

export default App;
